properties.npc\/02:
{
  "key_name": "alex",
  "label": "alex",
  "storage_keys": {
    "position": "alex_position",
    "animation": "alex_direction",
    "movement_type": "alex_movement_type"
  },
  "move_freely_in_event": true,
  "npc_type": "normal",
  "max_distance": 20,
  "step_duration": 10,
  "wait_duration": 90,
  "base_step": 4,
  "step_max_variation": 2,
  "message": "",
  "thought_message": "I don't know why you keep insisting on it.${BREAK}It's irrelevant...",
  "avatar": "alex",
  "base_collision_layer": 1,
  "events": [
    {
      "type": "branch",
      "condition": "=",
      "left_comparator_value": {
        "type": "storage",
        "value": {
          "key_name": "alex_walked"
        }
      },
      "right_comparator_value": {
        "type": "value",
        "value": false
      },
      "events": [
        {
          "type": "dialog",
          "dialog_info": {
            "text": "Let's try moving around..."
          },
          "npc_hero_reciprocal_look": true,
          "reset_reciprocal_look": false,
          "finish_events": [
            {
              "type": "look",
              "look": true,
              "looker_is_npc": false,
              "target_is_npc": true,
              "target_npc_label": "alex"
            },
            {
              "type": "move",
              "is_npc": true,
              "npc_label": "alex",
              "camera_follow": true,
              "dest": {
                "x": 19,
                "y": 13
              },
              "final_direction": "up_right",
              "follow_hero_on_finish": true,
              "finish_events": [
                {
                  "type": "look",
                  "look": false,
                  "looker_is_npc": false
                },
                {
                  "type": "move",
                  "is_npc": false,
                  "dash": true,
                  "dest": {
                    "x": 21,
                    "y": 12
                  },
                  "final_direction": "down_left",
                  "finish_events": [
                    {
                      "type": "dialog",
                      "dialog_info": {
                        "text": "Ok... I see that you can dash..."
                      },
                      "finish_events": [
                        {
                          "type": "set_value",
                          "event_value": {
                            "type": "storage",
                            "value": {
                              "key_name": "alex_walked",
                              "value": true
                            }
                          }
                        },
                        {
                          "type": "set_value",
                          "event_value": {
                            "type": "storage",
                            "value": {
                              "key_name": "alex_position",
                              "value": {
                                "x": 19,
                                "y": 13
                              }
                            }
                          }
                        },
                        {
                          "type": "set_value",
                          "event_value": {
                            "type": "storage",
                            "value": {
                              "key_name": "alex_direction",
                              "value": "up_right"
                            }
                          }
                        },
                        {
                          "type": "set_value",
                          "check_npc_storage_values": true,
                          "event_value": {
                            "type": "storage",
                            "value": {
                              "key_name": "alex_movement_type",
                              "value": "random"
                            }
                          }
                        }
                      ]
                    }
                  ]
                }
              ]
            }
          ]
        }
      ],
      "else_events": [
        {
          "type": "event_activation",
          "event_label": "reset_move_freely",
          "activate": false
        },
        {
            "type": "set_value",
            "active": false,
            "key_name": "reset_move_freely",
            "event_value": {
              "type": "game_info",
              "value": {
                "type": "npc",
                "label": "alex",
                "property": "move_freely_in_event",
                "value": true
              }
            }
        },
        {
          "type": "set_value",
          "event_value": {
            "type": "game_info",
            "value": {
              "type": "npc",
              "label": "alex",
              "property": "move_freely_in_event",
              "value": false
            }
          }
        },
        {
          "type": "branch",
          "condition": "=",
          "left_comparator_value": {
            "type": "game_info",
            "value": {
              "type": "char",
              "key_name": "piers",
              "property": "in_party"
            }
          },
          "right_comparator_value": {
            "type": "value",
            "value": true
          },
          "events": [
            {
              "type": "dialog",
              "end_with_yes_no": true,
              "npc_hero_reciprocal_look": true,
              "reset_reciprocal_look": false,
              "dialog_info": [
                {
                  "text": "It seems you're making new friends...${BREAK}You have been busy, haven't you?",
                  "consider_hero_direction": true
                }
              ],
              "yes_no_events": {
                "yes": [
                  {
                    "type": "dialog",
                    "dialog_info": [
                      {
                        "text": "Maybe now you can ask your friend to teach you Warp."
                      },
                      {
                        "avatar": "piers",
                        "voice_key": "adult_male_1",
                        "text": "What Psynergy is this?"
                      },
                      {
                        "text": "..."
                      }
                    ],
                    "finish_events": [{
                      "type": "event_caller",
                      "event_label": "reset_move_freely"
                    }]
                  }
                ],
                "no": [
                  {
                    "type": "dialog",
                    "dialog_info": [
                      {
                        "avatar": "piers",
                        "voice_key": "adult_male_1",
                        "text": "Is he a Water Adept?"
                      },
                      {
                        "text": "What a coincidence, no?${BREAK}Maybe now you can ask your friend to teach you Warp."
                      }
                    ],
                    "finish_events": [{
                      "type": "event_caller",
                      "event_label": "reset_move_freely"
                    }]
                  }
                ]
              }
            }
          ],
          "else_events": [
            {
              "type": "emoticon",
              "emoticon": "unhappy",
              "face_hero": true,
              "reset_direction": false,
              "finish_events": [
                {
                  "type": "dialog",
                  "dialog_info": {
                    "text": "Now I'm tired... ${BREAK}Call me another day so I can teach you Warp."
                  },
                  "npc_hero_reciprocal_look": true,
                  "finish_events": [{
                    "type": "event_caller",
                    "event_label": "reset_move_freely"
                  }]
                }
              ]
            }
          ]
        }
      ]
    }
  ]
}

